import React, { useState, useEffect } from 'react';
import axios from 'axios';


function App() {

  const [topFilms, setTopFilms] = useState([]);

    useEffect(() => {
        axios.get('/home_page')
            .then(response => {
                setTopFilms(response.data);
            })
            .catch(error => {
                console.error('Error fetching top films data:', error);
            });
    }, []);

    return (
        <div>
            <h1>Top Films</h1>
            <ul>
                {topFilms.map(film => (
                    <li key={film.id}>
                        {film.title} - {film.rating}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default App;
